import React from "react";
import classes from './RewardSettings.module.css';

const RewardSettings = props =>{

    return(
        <div className={classes['rewards-div']}>
            <div className={classes['rewards-heading']}>Rewards or Incentives:</div>
            <div className={classes['rewards-desc']}>Set self-rewards or incentives on the completion of the task</div>
            <div className={classes['rewards-desc']}>which motivates you to quickly complete the task.</div>
            <div className={classes['rewards-text-area']}>text area here</div>
        </div>

    );
}

export default RewardSettings;
